import React from 'react';
import Button from '../Button/Button';
import styles from './Profile.module.css';
const Profile = (props) => {
  let image = [
    'https://sebweo.com/wp-content/uploads/2019/06/landshaft-bernskikh-alp-v-yasniy-den_thumb.jpg',
    'http://fotorelax.ru/wp-content/uploads/2016/03/Beautiful-photos-and-pictures-on-various-subjects-01.jpg',
    'https://million-wallpapers.ru/wallpapers/6/7/292040288108207.jpg',
    'https://s1.1zoom.ru/big0/691/Scenery_Sunrises_and_sunsets_Fields_Sky_Grass_Sun_539960_1316x1024.jpg',
    'http://www.fonstola.ru/large/201308/108943.jpg',
  ];
  let number = ['1234567890'];
  return (
    <div className={styles.content}>
      <div>
        {image.map((url) => (
          <img src={url} alt="" />
        ))}
        {/* <img src="https://www.w3schools.com/css/img_5terre.jpg" alt="pelican" /> */}
      </div>
      <div className={styles.text}>
        {props.posts.map((item, index) => (
          <div key={index}>{item}</div>
        ))}
      </div>
      <div>
        <div>
          {number.map((numbers) => (
            <div>{numbers}</div>
          ))}
        </div>
        {props.alina.map((elem, index) => (
          <div key={index} className={styles.posts}>
            {elem}
          </div>
        ))}
        <Button text="Apply" />
      </div>
    </div>
  );
};

export default Profile;
